export default class Teams extends Component {
    state = {
    };

    componentDidMount() {
        this.loadTeams();
    };

    loadTeams = async () => {
        const leagueName = this.props.match.params;

        const response = await api.get(`teams/league/${leagueName}`);

        console.log(response)
    };

